function moreButtonOn(a,b){a.color="#040b25";a.backgroundColor="white";b.display="block"}function moreButtonOff(a,b){a.color="";a.backgroundColor="";b.display="none"}moreMenuOnclickHandler=function(a,b){return function(){if(b.display!=="none"){moreButtonOff(a,b)}else{moreButtonOn(a,b)}}};function setupMoreMenu(){var a=document.getElementById("show_navbar").querySelector("a").style;var b=document.getElementById("navbar_more").style;moreButtonOff(a,b);document.getElementById("show_navbar").onclick=moreMenuOnclickHandler(a,b)}function executeMobileJavascript(){var b=document.getElementsByClassName("flex_item");var c=document.getElementsByClassName("text_link");for(var a=0;a<c.length;a++){c[a].className+=" mobile"}for(var a=0;a<b.length;a++){b[a].querySelector("a").className+=" hover"}}function resetFlexItemPositions(){var c=document.getElementById("flex_item_container");var f=c.getBoundingClientRect();for(var b=0;b<flexItems.length;b++){var e=flexItems[b].getBoundingClientRect().width*flexItems.length;var d=(f.width-e)/2;var g=flexItems[b].getBoundingClientRect().width/2;var a=d;flexItems[b].style.transform="translate("+a+"px)";flexItems[b].style.left=0+"px";flexItems[b].startPosition=flexItems[b].getBoundingClientRect()}}var resizeFunction=function(){resetFlexItemPositions()};window.addEventListener("resize",resizeFunction);var flexItems;function rotateFlexItems(f){for(var d=0;d<flexItems.length;d++){flexItems[d].style.left=parseFloat(flexItems[d].style.left,10)+1+"px";var c=document.getElementById("carousel_right").getBoundingClientRect();var k=document.getElementById("carousel_left").getBoundingClientRect();if((parseFloat(flexItems[d].getBoundingClientRect().right)>=c.right)||(parseFloat(flexItems[d].getBoundingClientRect().left)<=k.left)){}else{flexItems[d].style.opacity="1"}var h=document.getElementById("flex_item_container");var e=h.getBoundingClientRect();var b=flexItems[d].getBoundingClientRect().width*flexItems.length;var a=flexItems[d].getBoundingClientRect().width/2;var g=(e.width-b)/2;var j=-flexItems[d].startPosition.left+e.left+g-a;console.log(g);if(flexItems[d].getBoundingClientRect().left>e.right-g-a){flexItems[d].style.left=j+"px"}}}function initFlexItems(){flexItems=document.getElementsByClassName("flex_item");resetFlexItemPositions();window.requestAnimFrame(step)}window.requestAnimFrame=(function(){return window.requestAnimationFrame||window.webkitRequestAnimationFrame||window.mozRequestAnimationFrame||function(a){window.setTimeout(a,1000/60)}})();var deltaTime=0;var lastTime=0;function step(a){if(lastTime===null){lastTime=a}deltaTime=(a-lastTime)/1000;rotateFlexItems(deltaTime);window.requestAnimFrame(step);lastTime=a}function runJavascript(){if("ontouchstart" in window){executeMobileJavascript()}setupMoreMenu();initFlexItems()}runJavascript();